import React from "react";
import SkillIcon from "./SkillIcon"

const skills = [
  {
    name: "C++",
    type: ["Computer Science", "Game Development", "Web Technology", "Data Engineering"],
    image: "https://upload.wikimedia.org/wikipedia/commons/thumb/1/18/ISO_C%2B%2B_Logo.svg/1200px-ISO_C%2B%2B_Logo.svg.png"
  }
];

const SkillSet = () => (
  <div className="skill-set-wrapper">
    <h2>My Perks</h2>
    <SkillIcon src={skills[0].image} caption={skills[0].name} />
  </div>
);

export default SkillSet;
